import React from 'react';
import './JoinPage.css';


const JoinPage = () => {
  return (
    <div className="about-container">
      <h1 className="about-title">A propos</h1>
      <p className="about-description">Nous sommes une équipe passionnée de fitness et de bien-être. Notre mission est de vous aider à atteindre vos objectifs de fitness en vous fournissant les meilleurs exercices et les meilleurs conseils pour vous aider à améliorer votre santé et votre bien-être. Nous vous proposons une variété d'exercices pour chaque catégorie, que vous soyez débutant ou avancé.</p>
    </div>
  );
};

export default JoinPage;
